221069500 **Narrative:**

As a user of Hygieia's Feature Widget, I want to be able to see when the last successful run time of the Feature collectors, so that I know how old my data is.

**Acceptance Criteria**
- [ ] The Feature Widget displays the last run time, similar to the other widget displays _(@sibaom:  Please verify this acceptance criteria after a PR is accepted)_

**Use Case**

```
GIVEN Hygieia's Feature Widget
WHEN A collector for the Feature Widget data successfully gathers data
THEN Hygieia's UI is updated to show the last successful run time for the Feature Widget, similar to the other widgets
```
